import React, { useState, useEffect } from 'react';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import axios from 'axios';
import Login from './components/Login';
import ItemList from './components/ItemList';

// Configure axios defaults
axios.defaults.baseURL = 'http://localhost:8080/api';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [user, setUser] = useState(null);
  const [token, setToken] = useState(localStorage.getItem('token'));

  useEffect(() => {
    // Check if user is logged in on app start
    if (token) {
      setIsLoggedIn(true);
      // You could verify the token here if needed
    }
  }, [token]);

  const handleLogin = (userData, userToken) => {
    setUser(userData);
    setToken(userToken);
    localStorage.setItem('token', userToken);
    setIsLoggedIn(true);
    toast.success('Login successful!');
  };

  const handleLogout = () => {
    setUser(null);
    setToken(null);
    localStorage.removeItem('token');
    setIsLoggedIn(false);
    toast.info('Logged out successfully');
  };

  const handleAddToCart = async (itemId) => {
    try {
      const response = await axios.post('/carts', 
        { item_id: itemId },
        { 
          headers: { 
            'Authorization': `Bearer ${token}`,
            'Content-Type': 'application/json'
          } 
        }
      );
      toast.success('Item added to cart!');
    } catch (error) {
      console.error('Error adding item to cart:', error);
      toast.error('Failed to add item to cart');
    }
  };

  const handleCheckout = async () => {
    try {
      // First get the user's cart
      const cartResponse = await axios.get('/carts', {
        headers: { 'Authorization': `Bearer ${token}` }
      });

      if (cartResponse.data.length === 0) {
        toast.error('Your cart is empty!');
        return;
      }

      const cart = cartResponse.data[0]; // Get the first cart

      // Create order from cart
      const orderResponse = await axios.post('/orders', 
        { cart_id: cart.id },
        { 
          headers: { 
            'Authorization': `Bearer ${token}`,
            'Content-Type': 'application/json'
          } 
        }
      );

      toast.success('Order placed successfully!');
    } catch (error) {
      console.error('Error creating order:', error);
      toast.error('Failed to place order');
    }
  };

  const handleViewCart = async () => {
    try {
      const response = await axios.get('/carts', {
        headers: { 'Authorization': `Bearer ${token}` }
      });

      if (response.data.length === 0) {
        toast.info('Your cart is empty');
        return;
      }

      const cart = response.data[0];
      const cartItems = cart.items.map(item => 
        `Item ID: ${item.item_id}, Name: ${item.item.name}, Price: $${item.item.price}`
      ).join('\n');

      alert(`Cart Items:\n${cartItems}`);
    } catch (error) {
      console.error('Error fetching cart:', error);
      toast.error('Failed to fetch cart');
    }
  };

  const handleViewOrders = async () => {
    try {
      const response = await axios.get('/orders', {
        headers: { 'Authorization': `Bearer ${token}` }
      });

      if (response.data.length === 0) {
        toast.info('No orders found');
        return;
      }

      const orderIds = response.data.map(order => `Order ID: ${order.id}`).join('\n');
      alert(`Your Orders:\n${orderIds}`);
    } catch (error) {
      console.error('Error fetching orders:', error);
      toast.error('Failed to fetch orders');
    }
  };

  return (
    <div className="App">
      <ToastContainer position="top-right" autoClose={3000} />
      
      {!isLoggedIn ? (
        <Login onLogin={handleLogin} />
      ) : (
        <div>
          <header className="header">
            <div className="container">
              <div className="header-content">
                <h1>E-commerce Store</h1>
                <div className="buttons-container">
                  <button className="btn btn-secondary" onClick={handleViewCart}>
                    Cart
                  </button>
                  <button className="btn btn-secondary" onClick={handleViewOrders}>
                    Order History
                  </button>
                  <button className="btn btn-success" onClick={handleCheckout}>
                    Checkout
                  </button>
                  <button className="btn btn-primary" onClick={handleLogout}>
                    Logout
                  </button>
                </div>
              </div>
            </div>
          </header>

          <div className="container">
            <ItemList onAddToCart={handleAddToCart} />
          </div>
        </div>
      )}
    </div>
  );
}

export default App;
